//Component to display the home page
export default function HomePage() {
  const mapContainer = useRef(null);
  const map = useRef(null);
  const [lng, setLng] = useState(28.05);
  const [lat, setLat] = useState(-26.2);
  const [zoom, setZoom] = useState(9);

  useEffect(() => {
    if (map.current) return; // initialize map only once
    map.current = new mapboxgl.Map({
      container: mapContainer.current,
      style: "mapbox://styles/mapbox/streets-v11",
      center: [lng, lat],
      zoom: zoom,
    });
  });

  return (
    <div className="Wrapper">
      <div className="Container">
        <div className="heatmapHeader">
          <h1>Heatmap</h1>
          <br />
          <br />
        </div>
        <div className="heatmapSubtext">
          {/* <p>
            Please login or register to view the dashboard. <br />
          </p> */}
          <div className="sidebar">
            <div>
              Longitude: {lng} | Latitude: {lat} | Zoom: {zoom}
            </div>
          </div>
          <div ref={mapContainer} className="map-container" />
        </div>
        {/* <row>
          <Tooltip title="Go to the login page">
